import React from "react";

const style = {
  backgroundColor: "#ccc",
  border: "3px solid #000",
  padding: "20px",
  margin: "0 auto",
  fontSize: "30px"
};

const UserInput = props => {
  return (
    <input
      style={style}
      type="text"
      onChange={props.handler}
      value={props.username}
    />
  );
};

export default UserInput;
